import React from "react";

const Footer = () => {
  const style = {
    position: "absolute",

    bottom: "env(safe-area-inset-bottom)",
    left: "0",
    right: "0",
    height: "50px",
    borderTop: "1px solid #000",
    padding: "5px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "13px",
  };

  return (
    <div style={style}>
      <div class="s-login__bar">
        <a
          href="https://mroom.com/fi/mymroom/"
          class="c-text-link"
          target="_blank"
        >
          What is My&nbsp;M&nbsp;Room?
        </a>
      </div>
    </div>
  );
};

export default Footer;
